import supertest from 'supertest';
import {expect} from 'chai';
const request=supertest('https://demoqa.com/Account/v1');

describe('UsersValidation',()=>{
    let token;
    let userId;
    before( (done) => {
        const username = `testuser_${Date.now()}`;
        
        request.post('/User')
        .send({
            "userName": username,
            "password": "Pkml12g5!"
          }).end((err,res1)=>{
            userId=res1.body.userID;
            
             request.post('/GenerateToken')
             .send({
                "userName": username,
                "password": "Pkml12g5!"
              }).end((err,res)=>{
                token=res.body.token;
              
                
              });
              done();
          });
      });
    it('UserName or Password not empty',(done)=>{
       request.post('/User')
       .send({
        "userName": "",
        "password": ""
      }).end((err,res)=>{
       expect(res.body.message).to.equal("UserName and Password required.");
       expect(res.status).to.equal(400);
        console.log(res);
        done();
       });
    });
    it('Password_validation',(done)=>{
        request.post('/User')
        .send({
            "userName": "Marin",
            "password": "Pkml12g5"
          }).end((err,res)=>{
             expect(res.body.message).to.equal("Passwords must have at least one non alphanumeric character, one digit ('0'-'9'), one uppercase ('A'-'Z'), one lowercase ('a'-'z'), one special character and Password must be eight characters or longer.");
             expect(res.status).to.equal(400);
             done();
          });
    });
    it('Password_Empty',(done)=>{
        request.post('/User')
       .send({
        "userName": "Marin Dimitrov",
        "password": ""
      }).end((err,res)=>{
       expect(res.body.message).to.equal("UserName and Password required.");
       expect(res.status).to.equal(400);
        console.log(res);
        done();
       });
    });
    it('UserName_Empty',(done)=>{
        request.post('/User')
       .send({
        "userName": "Marin Dimitrov",
        "password": ""
      }).end((err,res)=>{
       expect(res.body.message).to.equal("UserName and Password required.");
       expect(res.status).to.equal(400);
        console.log(res);
        done();
       });
    });
    it('User Already exists',(done)=>{
        request.post('/User')
        .send({
            "userName": "Marin",
            "password": "Pkml12g5!"
          }).end(()=>{
            request.post('/User')
            .send({
                "userName": "Marin",
                "password": "Pkml12g5!"
              }).end((err,res)=>{
                expect(res.body.message).to.equal("User exists!");
                console.log(res.body.message);
                console.log(token);
                console.log("-------------------------")
                console.log(userId);
                done();
              });
          });
    });
    it('User_CreatedSuccessfully',(done)=>{
         request.get(`/User/${userId}`)
         .set('Authorization',`Bearer ${token}`)
         .end((err,res)=>{
           expect(res.body.userId).to.equal(userId);
           done();
         });
    });

    

});

